import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Sdata from './Sdata';

ReactDOM.render(
    <>
    {Sdata.map((value) =>{
        return(
        <App 
        imagesrc={Sdata[0].imagesrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link} 
        />
        );

    })}


        </>,
   document.getElementById('root')
);
